import { Fragment } from "react";
import Header from './header.js'

const Notifications = ({ header, data }) => { return (
    <Fragment>
        <Header text={ header } />
        <div className={ 'notifications' }>
            <Content data={ data } />
        </div>
    </Fragment>
)}

const Content = ({ data }) => {
    switch (data.length) {

        // NO CONTENT FOUND
        case 0: { return (
            <div>No notifications.</div>
        )}

        default: { return (
            data.map(entry =>
                <div className={ 'item' } key={ entry._id }>
                    <div>{ entry.name }</div>
                    <div>{ entry.number }</div>
                </div>
            )
        )}
    }
}

export default Notifications;
